import React from 'react';
import './Breadcrumb.css';

function Breadcrumb() {
  return (
    <div className="breadcrumb">
      <span>Home</span> / <span>Folder 1</span> / <span>Subfolder</span>
    </div>
  );
}

export default Breadcrumb;
